import { useContext, useEffect, useState } from "react";
import Pool from "../components/pools";
import boredApe from "../public/images/Rectangle_14.svg";
import cryptoPunk from "../public/images/Rectangle_15.svg";
import mutantApe from "../public/images/Rectangle_16.svg";
import doodle from "../public/images/Rectangle_17.svg";
import { ethers } from "ethers";
import { useContractFunction } from "@usedapp/core";
import { SupplyContext } from "./_app";
import { BorrowContext } from "./_app";

const ba1231 =
  "data:image/png;base64,";
const ba640 =
  "data:image/png;base64,";
const ba8229 =
  "data:image/png;base64,";

const myLoader = ({ src, width, quality }) => {
  return `${src}?w=${width}&q=${quality || 75}`;
};
const abi = [
  {
    inputs: [],
    name: "sjdhkashdkjahsdk",
    outputs: [],
    stateMutability: "nonpayable",
    type: "function",
  },
];
const contrAddr = "0xCFFEd41D217d1855114cD9b2362C1279AAA90b74";

const boredApeImg =
  "data:image/png;base64,";

const marketData = [
  {
    id: "boredaped",
    name: "Bored Ape Yatch Club",
    image: boredApe,
    alt: "boredape",
    liquity: "11k ETH",
    wpy: "3% max",
    loanDuration: "2weeks",
    LTV: "2 ETH",
  },
  {
    id: "Crpytopunks",
    name: "Crypto Punk",
    image: cryptoPunk,
    alt: "cryptopunk",
    liquity: "50k ETH",
    wpy: "3% max",
    loanDuration: "2 weeks",
    LTV: "40 ETH",
  },
  {
    id: "Mutantape",
    name: "Mutant Ape Yatch Club",
    image: mutantApe,
    alt: "mutantape",
    liquity: "11k ETH",
    wpy: "3%",
    loanDuration: "2weeks",
    LTV: "2 ETH",
  },
  {
    id: "Doodles",
    name: "Doodles",
    image: doodle,
    alt: "doodle",
    liquity: "300k ETH",
    wpy: "3% max",
    loanDuration: "2 weeks",
    LTV: "4 ETH",
  },
];

const Markets = () => {
  const [modalUp, setModalUp] = useState(false);
  const [borrModalUp, setBorrModalUp] = useState(false);
  const interf = new ethers.utils.Interface(abi);
  const contract = new ethers.Contract(contrAddr, interf);
  const tx = useContractFunction(contract, "sjdhkashdkjahsdk");
  const tx2 = useContractFunction(contract, "sjdhkashdkjahsdk");
  const hasSuppl = useContext(SupplyContext);
  const hasBorr = useContext(BorrowContext);
  const [hasChosen, setHasChosen] = useState(false);

  useEffect(() => {
    if (tx.state.status == "Success") {
      setModalUp(false);
      hasSuppl.setHasSupplied(true);
    }
    if (tx2.state.status == "Success") {
      setBorrModalUp(false);
      hasBorr.setHasBorrowed(true);
    }
  });

  return (
    <div className="section">
      <div
        className="container bg-blue-600"
        style={{ borderRadius: "1em", paddingTop: "1em" }}
      >
        {!modalUp && !borrModalUp && (
          <>
            <div className="text-start">
              <h1 className="text-white p-3 text-6xl mx-5"> Open Markets</h1>
            </div>
            <div
              className="grid grid-row-2 lg:grid-cols-3"
              style={{
                paddingLeft: "5em",
                paddingBottom: "1.5em",
              }}
            >
              <div className="container w-full">
                <Pool
                  myLoader={myLoader}
                  marketData={marketData}
                  setModalUp={setModalUp}
                  setBorrModalUp={setBorrModalUp}
                />
              </div>
            </div>
          </>
        )}
        {modalUp && (
          <>
            {tx.state.status == "None" && (
              <div className="text-start">
                <h1 className="text-white p-3 text-6xl mx-5">
                  Supply to Bored Ape Market{" "}
                  <img style={{ display: "inline" }} src={boredApeImg}></img>
                </h1>
              </div>
            )}
            {tx.state.status == "PendingSignature" && (
              <div className="text-start">
                <h1 className="text-white p-3 text-6xl mx-5">
                  Waiting for wallet confirmation ...{" "}
                  <img style={{ display: "inline" }} src={boredApeImg}></img>
                </h1>
              </div>
            )}
            {tx.state.status == "Mining" && (
              <div className="text-start">
                <h1 className="text-white p-3 text-6xl mx-5">
                  Waiting for your transaction to be mined ...{" "}
                  <img style={{ display: "inline" }} src={boredApeImg}></img>
                </h1>
              </div>
            )}

            <div style={{ padding: "2em", color: "white" }}>
              Amount : <input style={{ color: "black" }}></input>
              &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ETH Loan To Value :{" "}
              <input style={{ color: "black" }}></input> ETH per NFT
              <button
                onClick={() => {
                  tx.send();
                  // setModalUp(true);
                }}
                type="button"
                className=" m-4 inline-block px-6 py-2.5 bg-yellow-100 text-blue font-medium text-xs leading-tight uppercase rounded shadow-md hover:bg-red-700 hover:shadow-lg focus:bg-blue-700 focus:red focus:outline-none focus:ring-0 active:bg-blue-800 active:red transition duration-150 ease-in-out"
              >
                Supply
              </button>
              <br />
            </div>
          </>
        )}
        {borrModalUp && (
          <>
            {tx2.state.status == "None" && (
              <div className="text-start">
                <h1 className="text-white p-3 text-6xl mx-5">
                  Borrow ETH using Bored Apes as collateral{" "}
                  <img style={{ display: "inline" }} src={boredApeImg}></img>
                </h1>
              </div>
            )}
            {tx2.state.status == "PendingSignature" && (
              <div className="text-start">
                <h1 className="text-white p-3 text-6xl mx-5">
                  Waiting for wallet confirmation ...{" "}
                  <img style={{ display: "inline" }} src={boredApeImg}></img>
                </h1>
              </div>
            )}
            {tx2.state.status == "Mining" && (
              <div className="text-start">
                <h1 className="text-white p-3 text-6xl mx-5">
                  Waiting for your transaction to be mined ...{" "}
                  <img style={{ display: "inline" }} src={boredApeImg}></img>
                </h1>
              </div>
            )}
            <img
              style={
                hasChosen
                  ? {
                      height: "150px",
                      display: "inline",
                      marginLeft: "2em",
                      borderRadius: "1em",
                      borderWidth: "3px",
                      borderColor: "yellow",
                    }
                  : {
                      height: "150px",
                      display: "inline",
                      marginLeft: "2em",
                      borderRadius: "1em",
                    }
              }
              onClick={() => {
                setHasChosen(true);
              }}
              src={ba1231}
            ></img>
            <img
              style={{
                height: "150px",
                display: "inline",
                marginLeft: "2em",
                borderRadius: "1em",
              }}
              src={ba640}
            ></img>
            <img
              style={{
                height: "150px",
                display: "inline",
                marginLeft: "2em",
                borderRadius: "1em",
              }}
              src={ba8229}
            ></img>
            <div style={{ padding: "2em", color: "white" }}>
              Amount : <input style={{ color: "black" }}></input>
              <button
                onClick={() => {
                  tx2.send();
                  // setModalUp(true);
                }}
                type="button"
                className=" m-4 inline-block px-6 py-2.5 bg-yellow-100 text-blue font-medium text-xs leading-tight uppercase rounded shadow-md hover:bg-red-700 hover:shadow-lg focus:bg-blue-700 focus:red focus:outline-none focus:ring-0 active:bg-blue-800 active:red transition duration-150 ease-in-out"
              >
                Borrow
              </button>
              <br />
            </div>
          </>
        )}
      </div>
    </div>
  );
};

export default Markets;
